member.summary:
The initial LatLng map center.
This is a new property which handles the Latitude and Longitude values.
The initial map center LatLng can be set through Latitude and Longitude properties of
Center or by comma seprated values pair string.
For example:

    GoogleMap1.Center.Latitude = 42.1229;
    GoogleMap1.Center.Longitude = 24.7879;

or
GoogleMap1.Center = "42.1229,24.7879";

The LatLng static map center position.
A property which handles the Latitude and Longitude values.
The static map center LatLng can be set through Latitude and Longitude properties of
Center or by comma separated values pair string.
For example:

    GoogleStaticMap1.Center.Latitude = 42.1229;
    GoogleStaticMap1.Center.Longitude = 24.7879;

or
GoogleStaticMap1.Center = "42.1229,24.7879";
